import './style.css'
import { Link }  from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
// import Image from 'react-bootstrap/Image';
// import Details  from './details';
import { CardContent } from './data'


function IncomeTrip() {

  const Data = CardContent()

  return (

    <>
    <Container>
      <div className='card-fly d-flex justify-content-between'>
        {CardHeader.map(renderingCardHeader)}
      </div>
      <div className='judul text-center'>
        <h1 className='fw-semibold'>Group Tour</h1>
      </div>

      <div className=' d-flex gap-4 justify-content-between flex-wrap'>

      {Data.map(card => (
      <Link to={`/details/${card.id}`} className="text-decoration-none">
        <Card style={{ width: '21rem',height:"21rem", padding:'7px', marginBottom:'40px'}}>
            <Card.Img variant="top" src={card.image} rounded/>
            <Card.Body>
                <Card.Title className="fw-semibold text-dark" >{card.tittle}</Card.Title>
                <div className='d-flex justify-content-between'>
                <p style={{color:'#FFAF00'}}>IDR. {card.idr}</p>
                <p className='text-secondary'>{card.city}</p>
                </div>
           </Card.Body>
          </Card>
      </Link>
      ))}
      </div>

      </Container>
    </>



  );
}


export default IncomeTrip;
